(18, 'Testcwtjob', 'Testcwtjob', '<p><p><strong><span class=\"fr-video fr-deletable fr-fvc fr-dvb fr-draggable\" contenteditable=\"false\" draggable=\"true\"><iframe width=\"640\" height=\"360\" src=\"https://www.youtube.com/embed/PfPC0WbX_co?&ampampampwmode=opaque\" frameborder=\"0\" allowfullscreen=\"\" class=\"fr-draggable\"></iframe></span></strong></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><strong>Demo NOTE:&nbspYou can edit this default content on admin CMS page (default_job_analysis.html?</strong></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><strong>Job Title: &nbsp &nbsp &nbsp</strong>&nbsp<br><strong>Classification:&nbsp</strong><br><strong>Department/Division</strong>:<br><strong>Location:</strong>&nbsp<br><strong>Pay Grade:</strong> &nbsp &nbsp &nbsp &nbsp &nbsp &nbsp &nbsp&nbsp</p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><br></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><strong>Job Requirements</strong></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><em>EXAMPLE:</em></p><ul style=\"padding: 0px 40px color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><li>A. Summary of Position</li></ul><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><em>Researches and identifies target client sectors for financial product services. Develops and implements a sales process to include initial contact, follow up, presentation and closing procedures. Maintains records of contacts and sales status including contact reports, sales projections and quota ratios.</em></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><br></p><ul style=\"padding: 0px 40px color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><li>B. Job Duties<br><br>1) Research and Create targeted new client lists within Orange County California territory<br><br>2) Makes initial contact with potential clients<br><br>3) Performs routine and regular follow up with potential clients<br><br>4) Performs routine and regular follow up with former clients<br><br>5) Visits potential clients and makes sales presentations<br><br>6) Closes sales<br><br>7) Maintains regular record reporting sales activity<br><br>&nbsp &nbsp</li><li>C. Computer Skills and Software Used<br><br>1) Windows operating system<br><br>2) MS Office including Word, Excel and PowerPoint<br><br>3) Constant Contact or other Customer Relations Management Software<br><br>&nbsp &nbsp</li><li>D. Reporting Structure<br><br>1) Reports to regional sales manager<br><br>2) Has nobody directly reporting to this position<br><br>&nbsp &nbsp 3) Required to participate in Annual Sales Meeting</li></ul><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><br></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><br></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><strong>Employee Requirements</strong></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><em>EXAMPLE:</em></p><ul style=\"padding: 0px 40px color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><li>A. Education and Training<br><br>1) Bachelor Degree in business, finance or accounting or 5 Years experience and High School Diploma. Bachelors Degree Preferred<br><br>2) ABC Financial Planning - Level 3 or higher (Fictional)<br><br>&nbsp &nbsp</li><li>B. Skills and Aptitudes<br><br>1) Fearless cold caller, 250+ Outbound calls per week<br><br>2) Ability to close a sale<br><br>3. Adapt to changing financial conditions and meet customer expectations<br><br>&nbsp &nbsp</li><li>C. Environment and Physical<br><br>1) Work in high volume sales office<br><br>2) Be able to sit for prolonged periods of time<br><br>3) Be able to travel to client locations 25% of time<br><br>&nbsp &nbsp</li><li>D. Licenses/Certifications<br><br>1) CFP - Certified Financial Planner<br><br>2) California Drivers License<br><br></li></ul><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><br></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><br></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><strong>Success Factors</strong></p><p style=\"color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><em>EXAMPLE:</em></p><ul style=\"padding: 0px 40px color: rgb(51, 51, 51) font-family: sans-serif, Arial, Verdana, &quotTrebuchet MS&quot font-size: 13px font-style: normal font-variant-ligatures: normal font-variant-caps: normal font-weight: 400 letter-spacing: normal orphans: 2 text-align: start text-indent: 0px text-transform: none white-space: normal widows: 2 word-spacing: 0px -webkit-text-stroke-width: 0px text-decoration-style: initial text-decoration-color: initial\"><li>A. Grow Sales<br><br>1) Increase market channel penetration by 30% in first Year<br><br>2) Develop 3 secondary channels in first 180 days<br><br>3) Grow referral-based sales from 15% to 20% in first year<br><br>&nbsp &nbsp</li><li>B. Develop Sales Department<br><br>1) Recruit and train 2 junior sales associates with gross sales of $500K by 3nd quarter<br><br>2) Increase number of sales presentations by 20% within 12 months<br><br>&nbsp &nbsp 3) Implement Web-Meeting presentation System to Reduce travel costs b