(163, 225, 'Web Developer', 224, 22, '26000-30000', '2019-10-10', 'inactive', 'no', 'Sverige', '2020-02-10', '', 'BE', '2', 'Nashik', 'Full Time', 1, '<p>A&nbsp;<strong>job description</strong>&nbsp;or JD is a written narrative that describes the general tasks, or other related duties, and&nbsp;<a href=\"https://en.wikipedia.org/wiki/Moral_responsibility\">responsibilities</a>&nbsp;of a position. It may specify the functionary to whom the position reports, specifications such as the&nbsp;<a href=\"https://en.wiktionary.org/wiki/qualification\">qualifications</a>&nbsp;or skills needed by the person in the job, information about the equipment, tools and work aids used, working conditions, physical demands, and a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Salary\">salary</a>&nbsp;range. Job descriptions are usually narrative,<a href=\"https://en.wikipedia.org/wiki/Job_description#cite_note-1\">[1]</a>&nbsp;but some may comprise a simple list of competencies; for instance,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Strategic_human_resource_planning\">strategic human resource planning</a>&nbsp;methodologies may be used to develop a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Competency_architecture\">competency architecture</a>&nbsp;for an organization, from which job descriptions are built as a shortlist of competencies.<a href=\"https://en.wikipedia.org/wiki/Job_description#cite_note-2\">[2]</a>[<em><a href=\"https://en.wikipedia.org/wiki/Wikipedia:Verifiability\">not specific enough to verify</a></em>]</p>\r\n\r\n<p>According to Torrington, a job description is usually developed by conducting a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Job_analysis\">job analysis</a>, which includes examining the tasks and sequences of tasks necessary to perform the job. The analysis considers the areas of&nbsp;<a href=\"https://en.wikipedia.org/wiki/Knowledge\">knowledge</a>,&nbsp;<a href=\"https://en.wikipedia.org/wiki/Skills\">skills</a>&nbsp;and&nbsp;<a href=\"https://en.wiktionary.org/wiki/abilities\">abilities</a>&nbsp;needed to perform the job. Job analysis generally involves the following steps: collecting and recording job information; checking the job information for accuracy; writing job descriptions based on the information; using the information to determine what skills, abilities, and knowledge are required to perform the job; updating the information from time to time.&nbsp;<a href=\"https://en.wikipedia.org/wiki/Job_description#cite_note-3\">[3]</a>&nbsp;A job usually includes several&nbsp;<a href=\"https://en.wikipedia.org/wiki/Role\">roles</a>. According to Hall, the job description might be broadened to form a&nbsp;<a href=\"https://en.wikipedia.org/wiki/Person_specification\">person specification</a>&nbsp;or may be known as &quot;<a href=\"https://en.wikipedia.org/wiki/Terms_of_reference\">terms of reference</a>&quot;. The person/job specification can be presented as a stand-alone document, but in practice it is usually included within the job description. A job description is often used by employers in the&nbsp;<a href=\"https://en.wikipedia.org/wiki/Recruitment\">recruitment</a>&nbsp;process.<a href=\"https://en.wikipedia.org/wiki/Job_description#cite_note-4\">[4]</a></p>', '', '', '', 0, 'crystal-web-techs-jobs-in-nashik-web-developer-163', '1.186.248.169', NULL, NULL, 'php, html, javascript', 0, '151', 'External', '', '', NULL, NULL, NULL, NULL, 8, 13, 10, 0, 'test note'),
